module aes_rcon(
    input clk,
    input kld,
    output reg [31:0] out
);

reg [3:0] rcnt;

always @(posedge clk) begin
    if (kld) begin
        rcnt <= 4'h1;
        out <= 32'h01_00_00_00;
    end else begin
        if (rcnt == 4'h9) begin
            rcnt <= 4'h0;
            out <= 32'h00_00_00_00;
        end else begin
            rcnt <= rcnt + 1;
            case (rcnt)
                4'h1: out <= 32'h02_00_00_00;
                4'h2: out <= 32'h04_00_00_00;
                4'h3: out <= 32'h08_00_00_00;
